        "15_factories": { "Identifier": "15_factories", "Name": "Avigliana", "Metadata": { "Description": "The factory in Avigliana in the 1890's. (From The Scientific American.)", "DeepZoom": { "Path": "Collections\\Factories\\15_factories\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Factories\\" + "15_factories.tif" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
        "16_factories": { "Identifier": "16_factories", "Name": "The production process", "Metadata": { "Description": "The process of producing explosives had several stages. The factories had different sections, each adapted a particular stage of production. Detail from a blueprint for the dynamite factory in Engene, outside Oslo.", "DeepZoom": { "Path": "Collections\\Factories\\16_factories\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Factories\\" + "16_factories.tif" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
        "17_factories": { "Identifier": "17_factories", "Name": "Nitroglycerin production", "Metadata": { "Description": "The factories often used gravity by placing the nitration houses highest up on a hill, for example, as at the factory in Ardeer. From there, the nitroglycerin and waste acids ran downhill through lead pipes to the separators and washhouses. After that, the nitroglycerin was transported to other buildings for further processing.", "DeepZoom": { "Path": "Collections\\Factories\\17_factories\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Factories\\" + "17_factories.tif" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
        "18_factories": { "Identifier": "18_factories", "Name": "Nitration", "Metadata": { "Description": "During the nitration process, it is extremely important that the temperature never exceeds 180 degrees centigrade. The worker responsible for watching the thermometer sat on a one-legged stool to keep him from falling asleep. Photograph from the dynamite factory in Ardeer.", "DeepZoom": { "Path": "Collections\\Factories\\18_factories\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Factories\\" + "18_factories.tif" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
        "19_factories": { "Identifier": "19_factories", "Name": "Mixing dynamite", "Metadata": { "Description": "Mixing dynamite at the factory in Isleten, Switzerland. At this time, around 1890, mixing was done by hand. Later, it was done by machine.", "DeepZoom": { "Path": "Collections\\Factories\\19_factories\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Factories\\" + "19_factories.tif" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
        "20_factories": { "Identifier": "20_factories", "Name": "Mixing dynamite", "Metadata": { "Description": "Mixing dynamite at the factory in Ardeer around 1880.", "DeepZoom": { "Path": "Collections\\Factories\\20_factories\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Factories\\" + "20_factories.tif" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
