        "22_factories": { "Identifier": "22_factories", "Name": "Cartridging dynamite", "Metadata": { "Description": "At the factory in Ardeer, dynamite was cartridged in small huts below the hill where nitroglycerin was made.", "DeepZoom": { "Path": "Collections\\Factories\\22_factories\\GeneratedImages\\dzc_output.xml" }, "Thumbnail": { "Path": "Collections\\" + "Factories\\" + "22_factories.tif" }, "AssocMediaView": "false", "Private": "false", "SortOptions": "{\"Title\":true,\"Date\":false,\"Artist\":false,\"Year of Award\":true,\"Citizenship 1\":true,\"Tours\":false}", "Timeline": "true", "Type": "Artwork", "ContentType": "Image" } },
