        "sohlman_4": { "Identifier": "sohlman_4", "Metadata": { "DeepZoom": { "Path": "Images\\Factories\\sohlman_4\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Ragnar Sohlman"," ", "Ragnar Sohlman (1870–1948) was Alfred Nobel’s assistant during the years 1893–96. He began his career with Nobel in Paris, and later also worked with Nobel in San Remo, as well as at Nobel’s experimental laboratory in Bofors, Sweden in 1896–97. In Alfred Nobel’s will, Sohlman, along with Rudolph Lilljequist, was appointed an executor of Nobel’s estate. It was largely due to Sohlman’s work that the Nobel Foundation could be established in 1900. Sohlman was the acting director of the Nobel Foundation during the period 1929–1946."] },
