        "factory_in_ardeer": { "Identifier": "factory_in_ardeer", "Metadata": { "DeepZoom": { "Path": "Images\\Homes\\factory_in_ardeer\\GeneratedImages\\dzc_output.xml" }, }, "SidebarInfo": ["<title>Factory in Ardeer", " ", "Alfred Nobel often painted a bleak picture of the traveling life. This example is taken from a letter to Sofie Hess, written in the St. Enoch’s Station Hotel in Glasgow:", " ", "“It was decided that I should depart for London yesterday evening, but the train that carried me from the factory was so delayed that I could not make my connection, and because in this God-fearing and pious country no trains run on Sunday, I sit here forsaken and captive in a hotel that is so large it resembles a city neighborhood.”"] },
