        "ludvig":{"Identifier": "ludvig","Metadata":{"DeepZoom":{"Path":"Images\\Will\\ludvig\\GeneratedImages\\dzc_output.xml"},},"SidebarInfo":["Ludvig Nobel (1831–88) was Alfred Nobel’s second oldest brother. After some of the Nobel family returned to Sweden, Ludvig Nobel rebuilt his father’s company in Russia, and specialized, among other things, in manufacturing rifles for the Russian army. After his brother Robert’s pioneering work in the oil industry in Baku, Ludvig Nobel also became involved in the oil company, and eventually took over the leadership of it."]},
