    function getLaureates(callback) {
        var doqarray = []
        for (var a = 0; a < 115; a++) {
            doqarray.push({
                "physics": [],
                "chemistry": [],
                "medicine": [],
                "literature": [],
                "peace": [],
                "economics": []
            })
        }
        var db = getDB().laureates;
        var waitingDoqs = {}
        var map = getMap();
        var doqs = []
        for (var i = 0; i < db.length; i++) {
            var ids = getID(db[i])
            for (var k = 0; k < ids.length; k++) {
                var id = ids[k]
                if (map[id]) {
                    var doq = jQuery.extend({},db[i])
                    doq.Private = false
                    doq.ContentType = "Image"
                    doq.Type = "Artwork"
                    doq.ID = id
                    doq.FullImagePath = map[id]
                    doq.FirstName = doq.firstname
                    doq.LastName = doq.surname
                    for (var d = 0; d < doq.prizes.length; d++) {
                        if (id.indexOf(doq.prizes[d].year) > -1) {
                            doq.Year = doq.prizes[d].year
                            if (doq.prizes[d].motivation !== undefined && doq.prizes[d].motivation.length > 0) {
                                doq.Motivation = doq.prizes[d].motivation
                            }
                            else {
                                doq.Motivation = noMotivationString
                            }

                        }
                    }
                    for (var d = 0; d < doq.prizes.length; d++) {
                        if (id.indexOf(doq.prizes[d].category) > -1) {
                            doq.PrizeCategory = doq.prizes[d].category.charAt(0).toUpperCase() + doq.prizes[d].category.slice(1);
                        }
                    }
                    doq.KeywordsSet1 = doq.Year.substring(0, 3) + "0s"
                    doq.KeywordsSet2 = doq.gender
                    doq.KeywordsSet3 = doq.PrizeCategory.toLowerCase();
                    waitingDoqs[map[id]] = { "Metadata": doq }
                    
                    Windows.Storage.KnownFolders.documentsLibrary.getFileAsync("NobelFolder\\" + "Thumbnails\\" + "thumb_" + map[id]).done(function (file) {
                        var url = URL.createObjectURL(file, { oneTimeOnly: true });
                        var d = waitingDoqs[file.name.substring(6)]
                        doqarray[parseInt(d.Metadata.Year)-1901][d.Metadata.PrizeCategory.toLowerCase()].push(d);
                        d.Metadata.Thumbnail = { "FilePath": url }
                        d.Identifier = d.Metadata.ID
                        doqs.push(d)
                    })
                    
                    Windows.Storage.KnownFolders.documentsLibrary.getFileAsync("NobelFolder\\" + "Mediums\\" + "medium_" + map[id]).done(function (file) {
                        var url = URL.createObjectURL(file, { oneTimeOnly: false });
                        var d = waitingDoqs[file.name.substring(7)]
                        d.Metadata.FullImage = { "FilePath": url }
                    })
                }
                else {
                    console.log("couldn't get map for: "+id)
                }
                }
            }

            function poll() {
                if (doqs.length >= Object.keys(map).length) {
                    setTimeout(function(){
                        var ds = []
                        var hash = {}
                        for (var i = 0; i < doqarray.length; i++) {
                            doqarray[i].physics.forEach(function (d) { if (!hash[d.Metadata.ID]) { ds.push(d); hash[d.Metadata.ID] = true } else { console.log(d.Metadata.ID + "was already added!")} })
                            doqarray[i].chemistry.forEach(function (d) { if (!hash[d.Metadata.ID]) { ds.push(d); hash[d.Metadata.ID] = true } else { console.log(d.Metadata.ID + "was already added!") } })
                            doqarray[i].medicine.forEach(function (d) { if (!hash[d.Metadata.ID]) { ds.push(d); hash[d.Metadata.ID] = true } else { console.log(d.Metadata.ID + "was already added!") } })
                            doqarray[i].literature.forEach(function (d) { if (!hash[d.Metadata.ID]) { ds.push(d); hash[d.Metadata.ID] = true } else { console.log(d.Metadata.ID + "was already added!") } })
                            doqarray[i].peace.forEach(function (d) { if (!hash[d.Metadata.ID]) { ds.push(d); hash[d.Metadata.ID] = true } else { console.log(d.Metadata.ID + "was already added!") } })
                            doqarray[i].economics.forEach(function (d) { if (!hash[d.Metadata.ID]) { ds.push(d); hash[d.Metadata.ID] = true } else { console.log(d.Metadata.ID + "was already added!")} })
                        }
                        var hash2 = {}
                        ds.forEach(function (l) {
                            var k = l.Metadata.Year + l.Metadata.PrizeCategory
                            if (!hash2[k]) {
                                hash2[k] = []
                            }
                            hash2[k].push(l)
                        })
                        var keys = Object.keys(hash2)
                        keys.forEach(function (k) {
                            var list = hash2[k]
                            if (list.length > 1) {
                                list.forEach(function (laur) {
                                    var collabs = []
                                    list.forEach(function (l) {
                                        if (l.Metadata.ID !== laur.Metadata.ID) {
                                            collabs.push(l)
                                        }
                                    })
                                    laur.Metadata.Collaborators = collabs
                                })
                            }
                            else {
                                list[0].Metadata.Collaborators = ""
                            }
                        })
                        console.log("number of laureates: " + ds.length)
                        doqs.forEach(function (d) {
                            var found  = false
                            ds.forEach(function (da) {
                                if (da.Metadata.ID == d.Metadata.ID) {
                                    found = true
                                }
                            })
                            if (found === false) {
                                console.log(d.Metadata.ID)
                            }
                        })
                        callback(ds);
                    },500)
                }
                else {
                    setTimeout(poll, 500);
                }
            }
            poll()
        }




    function getID(laur) {
        strings = []
        for (var p = 0; p < laur.prizes.length; p++) {
            var prize = laur.prizes[p]
            var string = ""
            if (laur.born) {
                string += laur.born
            }
            if (laur.died) {
                string += laur.died
            }
            if (laur.bornCountryCode) {
                string += laur.bornCountryCode
            }
            if (laur.diedCountryCode) {
                string += laur.diedCountryCode
            }
            if (prize.year) {
                string += prize.year
            }
            if (prize.category) {
                string += prize.category
            }
            strings.push(string)
        }
        return strings
    }

